export const navbarVariant = {
  initial: {
    opacity: 0,
  },
  animate: {
    opacity: 1,
    transition: {
      duration: 5,
      staggerChildren: 0.1,
    },
  },
  exit: {
    transition: {
      ease: "easeInOut",
    },
    x: "-110%",
    opacity: 0,
  },
};
